import React from 'react';
import { AppBar, Toolbar, Button, IconButton } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from 'react-router-dom';

const MyAppBar = () => {
  const navigate = useNavigate();
  
  const navigateHome = () => {
    navigate("/home");
  };

  const navigateAbout = () => {
    navigate("/about");
  };

  const handleLogout = () => {
    navigate("/");
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: '#3f51b5' }}>
      <Toolbar>
        <IconButton
          size="large"
          edge="start"
          color="inherit"
          aria-label="menu"
          sx={{ mr: 2 }}
        >
          <MenuIcon />
        </IconButton>
        <Button 
          color="inherit" 
          onClick={navigateHome} 
          sx={{
            fontSize: '1.2rem', // Larger font size
            padding: '12px 24px', // Bigger padding
            margin: '0 8px', // Add spacing between buttons
            flexGrow: 1 // Makes the button take up more space
          }}
        >
          Home
        </Button>
        <Button 
          color="inherit" 
          onClick={navigateAbout} 
          sx={{
            fontSize: '1.2rem',
            padding: '12px 24px',
            margin: '0 8px',
            flexGrow: 1
          }}
        >
          About
        </Button>
        <Button 
          color="inherit" 
          onClick={handleLogout} 
          sx={{
            fontSize: '1.2rem',
            padding: '12px 24px',
            margin: '0 8px',
            flexGrow: 1
          }}
        >
          Logout
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default MyAppBar;
